import logo from './logo.svg';
import './App.css';
const user = {
  name: 'Hedy Lamarr',
  imageUrl: 'https://i.imgur.com/yXOvdOSs.jpg',
  imageSize: 90,
};
function App() {
  let isLoggedIn = false;
  let content;
  if (isLoggedIn) {
    content = "Hello2";
  } else {
    content = "Hello1";
  }
  return (
    <div className="App">

      <h1>content</h1>
      <img
        className="avatar"
        src={user.imageUrl}
        alt={'Photo of ' + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }}
      />
    </div>

  );
}
function MyButton() {
  return (
    <button>I'm a button</button>
  );
}

export default App;
